    "Depending on that role you can link several states to the device. These will give the device its functionality.": {"en": "Depending on that role you can link several states to the device. These will give the device its functionality.", "de": "Je nach Rolle können Sie eine Verknüpfung mehrerer Staaten auf dem Gerät. Diese geben dem Gerät seine Funktionalität.", "ru": "В зависимости от этой роли можно связать несколько государств на устройство. Это даст устройству его функциональность.", "pt": "Dependendo do que papel você pode ligar vários estados para o dispositivo. Estes irão dar ao dispositivo a sua funcionalidade.", "nl": "Afhankelijk van die functie u kunt een koppeling van verschillende lidstaten aan op het apparaat. Hierdoor zal het apparaat dat de functionaliteit.", "fr": "Selon le rôle que vous pouvez lier plusieurs états de l'appareil. Il donnera à l'appareil de ses fonctionnalités.", "it": "A seconda del ruolo che si possono collegare diversi stati per il dispositivo. Questi darà il dispositivo per la sua funzionalità.", "es": "Dependiendo del papel que se puede vincular a varios estados para el dispositivo. Estos le darán el dispositivo de su funcionalidad.", "pl": "W zależności od tej roli można połączyć kilka państw na urządzenie. To daje urządzenia, jego funkcjonalność.", "zh-cn": "根据设备角色，关联相关状态值到该设备。"},
