    "If you select 'Link to other view' as role you can create links to other views. I suggest skinning Links to other views with the same Background, the linked view has.": {"en": "If you select 'Link to other view' as role you can create links to other views. I suggest skinning Links to other views with the same Background, the linked view has.", "de": "Wenn Sie die Option 'Verknüpfung zu anderen Ansichten' als Rolle verwenden, können Sie direkt zu einer anderen Ansicht springen. Es empfiehlt sich als Hintergrundbild das Bild der Ziel-Ansicht zu verwenden.", "ru": "Если вы выберите ссылка на другой вид как роль, которую вы можете создавать ссылки на другие мнения. Я предлагаю шкуры ссылки на другие мнения, с тем же фоном, связанного мнение.", "pt": "Se você selecionar 'Ligação para outro modo de exibição' como função você pode criar links para outros pontos de vista. Eu sugiro que esfola Links para outros pontos de vista com o mesmo plano de Fundo, o modo de exibição vinculado.", "nl": "Als u kiest voor 'Link naar een andere weergave' als de rol die u kunt koppelingen maken naar andere weergaven. Ik stel voor het villen van Links naar andere weergaven met dezelfde Achtergrond, is de gekoppelde weergave heeft.", "fr": "Si vous sélectionnez \"Lien à l'autre point de vue\", comme le rôle que vous pouvez créer des liens vers d'autres points de vue. Je suggère de le dépouillement des Liens vers d'autres points de vue avec le même arrière-plan, liés vue.", "it": "Se si seleziona il Link per la visualizzazione di altri' come ruolo è possibile creare collegamenti ad altri punti di vista. Io suggerisco di skinning Link ad altri punti di vista con lo stesso Sfondo, la vista collegata.", "es": "Si selecciona 'Enlace a otro punto de vista' como papel puede crear enlaces a otros puntos de vista. Sugiero desollar Enlaces a otros puntos de vista con el mismo Fondo, la vinculada vista tiene.", "pl": "Jeśli wybierzesz link na inny wygląd jak rola, jaką można tworzyć łącza do innych opinii. Proponuję skóry linki na inne opinie, z tym samym tłem, związanego zdanie.", "zh-cn": "如果选择设备角色为\"链接到其他页面\"，您可以创建链接到其他显示页面的图标。建议将两个显示页面的背景图片设置为一致的图片。"},
