    "The first Toolbar-Entry will be your 'Home-View' with will be loaded at start.": {"en": "The first Toolbar-Entry will be your 'Home-View' with will be loaded at start.", "de": "Die ersten Toolbar-Eintrag wird die \"Startseite\", die bei jedem Start aufgerufen wird.", "ru": "Первая панель инструментов-запись будет свой дом-вид С будет загружаться при старте.", "pt": "A primeira barra de Ferramentas-Entrada vai ser a sua \"Casa-Vista' com a vontade de ser carregado no início.", "nl": "De eerste Werkbalk-Invoer zal uw 'Home-View' wordt geladen bij het starten.", "fr": "La première Barre d'outils-Entrée de votre Maison-Vue \" avec sera chargé au départ.", "it": "La prima Barra degli strumenti-Voce di essere la vostra Casa con Vista' con la volontà di essere caricati all'avvio.", "es": "La primera Barra de herramientas de Entrada va a ser su Hogar-Ver \" con la voluntad de ser cargado en el arranque.", "pl": "Pierwszy pasek narzędzi-nagrywanie będzie swój dom-widok Z będzie się uruchamiać przy starcie.", "zh-cn": "第一个导航栏条目将作为您UI界面的默认页面。"},
    "The free builtin demo-wallpapers are from www.pexels.com.": {"en": "The free builtin demo-wallpapers are from www.pexels.com.", "de": "Die kostenlosen Demo-Hintergrundbilder kommen von www.pexels.com.", "ru": "Бесплатные встроенные демо-обои из www.pexels.com.", "pt": "O livre builtin demo-papéis de parede são de www.pexels.com.", "nl": "De gratis ingebouwde demo-wallpapers zijn van www.pexels.com.", "fr": "La libre builtin démo-fonds d'écran sont de www.pexels.com.", "it": "Il libero builtin demo-sfondi sono da www.pexels.com.", "es": "La libre builtin demo-fondos de pantalla son de www.pexels.com.", "pl": "Darmowe wbudowane demo tapety z www.pexels.com.", "zh-cn": "适配器免费的内建壁纸来自于www.pexels.com。"},
    "The name of the device could not be determined and was set to": {"en": "The name of the device could not be determined and was set to", "de": "Der Name des Gerätes konnte nicht ermittelt werden und wurde daher gesetzt auf", "ru": "Имя устройства не может быть определено и задано", "pt": "O nome do dispositivo não pôde ser determinado e foi definido para", "nl": "De naam van het apparaat kan niet worden bepaald en is ingesteld op", "fr": "Le nom de l'appareil n'a pas pu être déterminé et a été mis à", "it": "Il nome del dispositivo non può essere determinato, ed è stato fissato per", "es": "El nombre del dispositivo no pudo ser determinada y se establece en", "pl": "Nazwa urządzenia nie może być określona i ustawiona", "zh-cn": "设备的名称不能确定和设定为"},
    "The role of the device is unknown. Please set it manually.": {"en": "The role of the device is unknown. Please set it manually.", "de": "Die Rolle des Gerätes ist unbekannt. Bitte weise diese manuell zu.", "ru": "Роль устройства неизвестна. Пожалуйста, установите его вручную.", "pt": "A função do dispositivo é desconhecido. Por favor configure-a manualmente.", "nl": "De rol van het toestel is onbekend. Houdt u deze handmatig instellen.", "fr": "Le rôle de l'appareil est inconnu. Veuillez le régler manuellement.", "it": "Il ruolo del dispositivo è sconosciuto. Si prega di impostare manualmente.", "es": "La función del dispositivo es desconocido. Por favor, configure manualmente.", "pl": "Rolę urządzenia nieznany. Proszę zainstalować go ręcznie.", "zh-cn": "未配置设备的角色，请设置设备角色。"},
    "The selected Device will be copied to View ": { "en": "The selected Device will be copied to View ",     "de": "Das Gerät wird in folgende Ansicht kopiert: ",    "ru": "Выбранное устройство будет скопировано для просмотра", "pt": "O dispositivo selecionado será copiado para View", "nl": "Het geselecteerde apparaat wordt gekopieerd naar Weergave", "fr": "Le périphérique sélectionné sera copié dans View", "it": "Il dispositivo selezionato verrà copiato in Visualizza", "es": "El dispositivo seleccionado se copiará a la vista", "pl": "Wybrane urządzenie zostanie skopiowane do widoku", "zh-cn": "选定的设备将复制到View"},
    "The uploaded images have been moved to a new location. This is only done once and allowes automatic backup of these files by iobroker. Please reload this site and save the settings, so all filenames can be updated!": {"en": "The uploaded images have been moved to a new location. This is only done once and allowes automatic backup of these files by iobroker. Please reload this site and save the settings, so all filenames can be updated!", "de": "Die hochgeladenen Bilder wurden in ein neues Verzeichnis verschoben. Dies wird nur einmalig durchgeführt und dient dazu, die Dateien über die Backup-Funktion von ioBroker sichern zu können. Bitte laden Sie diese Seite neu und speichern Sie dann die Einstellungen, dabei werden die Dateinamen der Bilder automatisch angepasst!", "ru": "Загруженные изображения были перемещены в новое место. ", "pt": "As imagens enviadas foram movidas para um novo local. ", "nl": "De geüploade afbeeldingen zijn verplaatst naar een nieuwe locatie. ", "fr": "Les images téléchargées ont été déplacées vers un nouvel emplacement. ", "it": "Le immagini caricate sono state spostate in una nuova posizione. ", "es": "Las imágenes cargadas se han movido a una nueva ubicación. ", "pl": "Przesłane obrazy zostały przeniesione do nowej lokalizacji. ", "zh-cn": "上传的图像已移至新位置。"},
