    "This is Alpha - still very buggy. Check the device after creation and edit it to correct role and states.": {"en": "This is Alpha - still very buggy. Check the device after creation and edit it to correct role and states.", "de": "Dies ist Alpha - noch sehr buggy. Überprüfen Sie das Gerät nach dem anlegen und Bearbeiten, um die richtige Rolle und Staaten.", "ru": "Это Альфа - еще очень глючный. Проверьте устройство после создания и редактирования для исправления и роль государства.", "pt": "Este é o Alpha - ainda muito buggy. Verifique o dispositivo após a criação e editar-lo para corrigir o papel e estados.", "nl": "Dit is Alpha - nog steeds erg buggy. Controleer het apparaat na het maken en bewerken om de juiste rol en de lidstaten.", "fr": "C'est de l'Alpha - encore très buggé. Vérifiez que le dispositif après la création et l'éditer pour corriger rôle et les états.", "it": "Questo è l'Alfa - ancora molto instabile. Controllare il dispositivo dopo la creazione e la modifica per correggere ruolo e stati.", "es": "Esta es la Alfa - todavía muy buggy. Compruebe el dispositivo después de la creación y de edición para corregir papel y de los estados.", "pl": "To Alfa jeszcze bardzo глючный. Sprawdź, czy urządzenie po tworzenia i edycji poprawki i rolę państwa.", "zh-cn": "此功能处于开发阶段。设备自动创建后请检查并更正角色和状态。"},
