    "edit description": {                            "en": "In edit mode you can add, delete or modify the extensions. Additionally the elements can be sorted or styled.", "de": "Im Bearbeitungs-Modus können Bilder hinzugefügt, bearbeitet und gelöscht werden, außerdem können per Drag&Drop Elemente umsortiert und Bilder hochgeladen werden.", "ru": "В режиме изменений можно добавить, изменить или удалить объекты, кроме того можно перетаскивая изменить порядок элементов, а также загрузить иконки.", "pt": "No modo de edição, você pode adicionar, excluir ou modificar as extensões. Além disso, os elementos podem ser ordenados ou estilo.", "nl": "In de bewerkingsmodus kunt u toevoegen, verwijderen of wijzigen van de extensie. Bovendien, de elementen kunnen worden gesorteerd of gestyled.", "fr": "En mode édition, vous pouvez ajouter, supprimer ou modifier les extensions. En outre, les éléments peuvent être triées ou de style.", "it": "In modalità di modifica, è possibile aggiungere, eliminare o modificare le estensioni. Inoltre gli elementi possono essere ordinati o di stile.", "es": "En el modo de edición usted puede agregar, eliminar o modificar las extensiones. Además, los elementos se pueden ordenar o estilo.", "pl": "W trybie edycji można dodawać, usuwać lub zmieniać rozszerzenia. Ponadto, elementy, które mogą być sortowane lub stylu.", "zh-cn": "在编辑模式下，您可以添加、删除或修改扩展。此外，可以对元素进行排序或设置样式。"},
